import React from 'react'
import Particles from 'react-particles-js';


const particlesOpt = {
  particles: {
    number: {
      value: 90,
      density: {
        enable: true,
        value_area: 800
      }

    }

  }
}
export default function Home() {

  return (

    <div className='wrapper-page-home home-fade-enter home-fade-exit'>

      <section className='wrapper-home-p'>
        <Particles params={particlesOpt} />
        <p className='home-text'>I'm Andrea!</p>
        <p className='home-text'>Full Stack Dev  | Blogger | Dungeons crawler</p>
      </section>
    </div>
  )
}
